import React from 'react';
import Layout from '../Layout';
import './Cart.css';
import CartItems from './CartItems';

function Cart() {

  return (
    <Layout>
      <h1>Cart</h1>
      <div className="cart-container">
        <CartItems />
        <div className="cart-total">Total</div>
      </div>
    </Layout>
  )
}

export default Cart;
